  "text" : "\uACF5\uD3EC\uB294 \uC0DD\uAC01\uC744 \uB9C8\uBE44\uC2DC\uD0A8\uB2E4. \uD558\uC9C0\uB9CC \uC544\uC9C1 \uB0B4 \uC0AC\uACE0\uC758 \uC9C0\uD3C9\uC740 \uADF8\uB9AC \uB113\uC9C0 \uBABB\uD558\uB2E4. \uC774 \uC5B4\uC911\uAC04\uD55C \uB098\uC774\uB294 \uB098\uC774 \uC790\uCCB4\uC758 \uACF5\uD3EC\uB3C4 \uB9CC\uB9CC\uCE58 \uC54A\uB2E4. \uACBD\uD5D8\uC758 \uBD80\uC871, \uC5F4\uC815\uC758 \uBD80\uC871.. \uC704\uD5D8\uD55C \uB098\uC774..",
