  "id_str" : "8368733306",
  "text" : "\uB09C \uC804\uBB38\uC6A9\uC5B4\uB3C4 \uC798 \uBAA8\uB978\uB2E4. \uB09C \uB204\uAD70\uAC00\uC5D0 \uBE44\uD574 \uC544\uB294 \uAC83\uB3C4 \uC801\uB2E4. \uB09C \uB204\uAD70\uAC00\uC5D0 \uBE44\uD574 \uACBD\uD5D8\uB3C4 \uC801\uB2E4. \uD558\uC9C0\uB9CC \uB09C \uC0DD\uAC01\uC774\uB77C\uB294 \uAC83\uC744 \uD55C\uB2E4. \uB9CE\uC774 \uB4E3\uACE0 \uB9CE\uC774 \uB9D0\uD558\uB294 \uAC83\uC744 \uC990\uAE30\uB294 \uAC83\uC740 \uC8C4\uAC00 \uB418\uC9C0 \uC54A\uB294 \uAC83\uC77C\uAE4C? \uC694\uC998\uC740 \uADF8\uB0E5 \uB9C8\uC74C\uB9CC \uC55E\uC11C\uB294 \uAC83 \uAC19\uB2E4.",
