  "id_str" : "8368754065",
  "text" : "\uC694\uC998\uC740 \uC544\uB294 \uAC83\uB3C4 \uC5C6\uC73C\uBA74\uC11C \uB2E4\uB978 \uC0AC\uB78C\uB4E4\uC5D0\uAC8C \uB0B4 \uC774\uC57C\uAE30\uB97C \uB4E4\uC5B4\uB2EC\uB77C\uACE0 \uC0DD\uB5BC\uB97C \uBD80\uB9AC\uB294 \uAC74 \uC544\uB2CC\uAC00? \uB77C\uB294 \uB450\uB824\uC6C0\uC774 \uC788\uB2E4. \uD2B9\uD788\uB098 \uC8FC\uBCC0\uC5D0 \uB108\uBB34 \uC720\uBA85\uD55C \uC0AC\uB78C\uB4E4\uC774 \uB9CE\uB2E4 \uBCF4\uB2C8 \uB354 \uC8FC\uB205\uC774 \uB4E0\uB2E4.",
