  "id_str" : "8368780558",
  "text" : "\uC0AC\uB78C\uB4E4\uC740 \uC5B4\uB824\uC6B4 \uC804\uBB38\uC6A9\uC5B4\uC640 \uC790\uC2E0\uC758 \uACBD\uD5D8\uC744 \uC801\uC808\uD788 \uBC84\uBB34\uB824 \uC774\uC57C\uAE30 \uD558\uB294 \uC0AC\uB78C\uC744 \uC804\uBB38\uAC00\uB77C \uD55C\uB2E4. \uD558\uC9C0\uB9CC \uADF8\uB7F0 \uC0AC\uB78C \uC911\uC5D0\uB294 \uC9C0\uC2DD\uC758 \uC800\uC8FC\uC5D0 \uAC78\uB824 \uB4E3\uB294 \uC0AC\uB78C\uC744 \uACE0\uB824\uD558\uC9C0 \uBABB\uD558\uB294 \uC0AC\uB78C\uB3C4 \uB9CE\uB2E4. \uADF8\uB7F0 \uC0AC\uB78C\uB3C4 \uC804\uBB38\uAC00\uC77C\uAE4C?",
