  "text" : "\uB09C \uC0AC\uC6A9\uC131 \uD14C\uC2A4\uD2B8\uB97C \uD558\uC9C0\uB9CC \uD1B5\uACC4\uC5D0\uB294 \uC57D\uD558\uB2E4. \uC0AC\uC6A9\uC131 \uD14C\uC2A4\uD2B8\uC5D0 \uB2A5\uC219\uD558\uACE0 \uD1B5\uACC4\uC5D0 \uAC15\uD55C \uC0AC\uB78C\uC744 \uC774\uAE38 \uBC29\uBC95\uC774 \uB9CE\uC9C0 \uC54A\uB2E4. \uD558\uC9C0\uB9CC \uB09C \uB0B4 \uC790\uC2E0\uC774 \uADF8\uB4E4\uBCF4\uB2E4 \uBABB\uD558\uB2E4\uACE0 \uC0DD\uAC01\uD558\uC9C0 \uBABB\uD55C\uB2E4. \uB09C \uC804\uCCB4\uB97C \uBCFC \uC218 \uC788\uB294 \uB2A5\uB825\uC774 \uC788\uB2E4.",
