  "text" : "\uC6B0\uB9AC\uB294 \uC544\uC9C1\uAE4C\uC9C0 \uC5B4\uB5A4 \uC131\uB2A5\uC744 \uBCFC \uB54C \uD558\uB4DC\uC6E8\uC5B4\uC801\uC778 \uC2A4\uD399\uC5D0 \uB9E4\uB2EC\uB9AC\uB294 \uACBD\uD5A5\uC774 \uC788\uC2B5\uB2C8\uB2E4. \uD558\uC9C0\uB9CC \uC9C4\uC815\uD55C \uC131\uB2A5 \uD14C\uC2A4\uD2B8\uB294 \uC0AC\uB78C\uC758 \uCCB4\uAC10\uC744 \uCE21\uC815\uD558\uB294\uAC70\uB77C\uACE0 \uC0DD\uAC01\uD569\uB2C8\uB2E4. \uC544\uBB34\uB9AC \uC790\uB3D9\uD654 \uB3C4\uAD6C\uC5D0\uC11C \uC88B\uC740 \uACB0\uACFC\uAC00 \uB098\uC628\uB2E4 \uD574\uB3C4 \uC0AC\uC6A9\uC790\uAC00 \uD0DC\uC2A4\uD06C\uC5D0 \uAC78\uB9AC\uB294 \uC2DC\uAC04\uC774 \uC624\uB798 \uAC78\uB9B0\uB2E4\uBA74..",
