  "text" : "\uC81C\uAC00 \uC0DD\uAC01\uD558\uB294 \uC644\uC131\uB3C4 \uB192\uC740 \uD14C\uC2A4\uD2B8\uC758 \uC815\uC758 \uC911 \uD558\uB098\uB294 \uCD9C\uC2DC \uD6C4\uC5D0 \uD558\uB8E8 \uC548\uC5D0 \uD574\uACB0 \uBD88\uAC00\uB2A5\uD55C \uACB0\uD568\uC774 \uBC1C\uC0DD\uD558\uC9C0 \uC54A\uB3C4\uB85D \uC0AC\uC804\uC5D0 \uACB0\uD568\uC744 \uCD5C\uB300\uD55C \uC904\uC774\uB294 \uAC83\uC774 \uC644\uC131\uB3C4 \uB192\uC740 \uD14C\uC2A4\uD2B8 \uC911 \uD558\uB098\uB77C\uACE0 \uC0DD\uAC01\uD569\uB2C8\uB2E4. \uC5B4\uCC28\uD53C \uBAA8\uB4E0 \uACB0\uD568\uC744 \uCC3E\uB294\uB2E4\uB294\uAC74 \uC560\uC2DC\uB2F9\uCD08 \uBD88\uAC00\uB2A5\uD558\uB2C8\uAE4C\uC694.",
