  "text" : "\uD1B5\uACC4\uB294 \uBD84\uBA85 \uBBFF\uC744 \uC218 \uC788\uB294 \uAC83\uC774 \uBD84\uBA85\uD558\uB2E4. \uBB38\uC81C\uB294 \uD1B5\uACC4\uB97C \uB9CC\uB4DC\uB294 \uC0AC\uB78C\uC774\uB2E4. \uB2F9\uC2E0\uC5D0\uAC8C \uB358\uC838\uC9C4 \uD1B5\uACC4 \uB370\uC774\uD130\uB97C \uC561\uBA74 \uADF8\uB300\uB85C \uBBFF\uC9C0 \uB9D0\uACE0 \uADF8 \uC774\uBA74\uC5D0 \uAE54\uB9B0 \uC758\uB3C4\uB97C \uBA3C\uC800 \uC77D\uC744 \uC904 \uC54C\uC544\uC57C \uD55C\uB2E4. \uADF8\uB7F0 \uC758\uBBF8\uC5D0\uC11C \uC0AC\uC6A9\uC131 \uD14C\uC2A4\uD130\uB4E4\uC744 \uD68C\uC0AC\uC758 \uAC1C\uAC00 \uB418\uC5B4\uC11C\uB294 \uC548\uB41C\uB2E4.",
