  "text" : "\uC0AC\uB78C\uC740 \uD658\uACBD\uC758 \uC9C0\uBC30\uB97C \uBC1B\uC9C0\uB9CC \uD658\uACBD\uC744 \uC9C0\uBC30\uD55C\uB2E4\uACE0 \uC624\uD574\uD55C\uB2E4. \uC0AC\uB78C\uC740 \uB9CC\uC871\uD558\uC9C0 \uBABB\uD558\uACE0 \uB04A\uC784\uC5C6\uC774 \uD658\uACBD\uC744 \uD0D3\uD558\uC9C0\uB9CC \uC2E4\uC0C1 \uBB38\uC81C\uB294 \uC790\uAE30 \uC790\uC2E0\uC774\uB2E4. \uC778\uAC04\uC740 \uC65C \uB9CC\uC871\uD558\uC9C0 \uBABB\uD558\uB294 \uAC83\uC77C\uAE4C? \uC778\uAC04\uC740 \uC65C \uD56D\uC0C1 \uBCC0\uD558\uB294 \uAC83\uC77C\uAE4C? \uB313\uAE00\uC774 \uC5C6\uC73C\uBA74 \uC5C6\uB2E4\uACE0 \uACE0\uBBFC. \uB9CE\uC73C\uBA74 \uB9CE\uB2E4\uACE0 \uACE0\uBBFC",
