  "text" : "\uC0AC\uC2E4 \uB3C8\uC774\uB780 \uBB34\uD615\uC758 \uAC00\uCE58\uB97C \uC778\uC2DD\uD558\uAE30 \uC704\uD574 \uC0DD\uACA8\uB09C \uAC83\uC778\uB370.. \uC774 \uBB34\uD615\uC758 \uAC00\uCE58\uB97C \uC778\uC2DD\uD558\uB294 \uAE30\uC900\uC740 \uAC01 \uC0AC\uB78C\uB4E4\uC758 \uC774\uD574\uC5D0 \uB530\uB77C \uCC9C\uC591\uC9C0\uCC28\uC774\uB2E4. \uC774\uAC83\uC744 \uADF9\uBCF5\uD558\uACE0 \uC790\uC2E0\uC758 \uAC00\uCE58\uB97C \uB2E4\uB978 \uC0AC\uB78C\uC5D0\uAC8C \uC8FC\uC785\uD558\uB294 \uC0AC\uB78C\uC744 \uC6B0\uB9AC\uB294 \uC0D0\uB7EC\uB9AC\uB9E8 \uC989 \uC601\uC5C5\uC778\uC774\uB77C \uBD80\uB978\uB2E4.",
