  "text" : "\uC6B0\uB9AC\uB294 \uC22B\uC790\uAC00 \uAC1D\uAD00\uC801\uC774\uB2E4\uB77C\uACE0 \uBBFF\uC9C0\uB9CC \uC774\uAC83\uC740 \uC6B0\uC0C1\uC22D\uBC30\uB098 \uB2E4\uB984\uC5C6\uB2E4. \uC22B\uC790\uB294 \uC6B0\uB9AC\uAC00 \uC5B4\uB5A4 \uC0AC\uBB3C\uC744 \uAC1D\uAD00\uC801\uC73C\uB85C \uC778\uC2DD\uD560 \uC218 \uC788\uB3C4\uB85D \uC624\uD574\uD558\uAE30 \uC26C\uC6B4 \uC644\uC804\uD788 \uCD94\uC0C1\uC801\uC778 \uAC1C\uB150\uC774\uB2E4. \uC774\uAC83\uC774 \uD1B5\uACC4\uD559\uC758 \uB9C8\uBC95\uC774\uACE0, \uD658\uACBD\uC5D0 \uC758\uD574 \uC6B0\uB9AC\uAC00 \uC9C0\uBC30\uBC1B\uC744 \uC218\uBC16\uC5D0 \uC5C6\uB294 \uC774\uC720\uC774\uB2E4.",
