  "id_str" : "7977123103",
  "text" : "\uC778\uAC04\uC758 \uC0AC\uD68C\uAC00 \uBD84\uC5C5\uD654 \uB418\uBA74\uC11C \uBD84\uC5C5, \uBBF8\uC801\uBD84\uACFC \uAC19\uC740 \uAC1C\uB150\uC774 \uC0AC\uD68C \uC804\uBC18\uC5D0 \uCDA9\uB9CC\uD574\uC9D0\uC73C\uB85C\uC368 \uC624\uD788\uB824 \uC778\uAC04\uC758 \uC0AC\uACE0 \uB2A5\uB825\uC774 \uD604\uC800\uD558\uAC8C \uB5A8\uC5B4\uC9C4 \uCE21\uBA74\uC774 \uC788\uB2E4. \uC6B0\uB9AC\uB294 \uC608\uC804\uCC98\uB7FC \uC804\uCCB4\uB97C \uBCF4\uACE0 \uD1B5\uCC30\uB825\uC744 \uBD80\uC5EC\uD558\uACE0 \uC0AC\uD68C\uB97C \uC774\uB04C\uB358 \uB9CC\uBB3C\uBC15\uC0AC\uC640 \uAC19\uC740 \uC0AC\uB78C\uC744 \uC810\uC810 \uB9CC\uB098\uAE30 \uD798\uB4E4\uB2E4.",
