  "text" : "80\uB144\uB300 \uC774 \uB545\uC758 \uBBFC\uC8FC\uD654 \uC6B4\uB3D9\uC744 \uC774\uB04C\uC5C8\uB358 \uBCC0\uC808\uC790\uB4E4\uC740 \uADF8\uB54C \uC774\uB7F0 \uC138\uC0C1\uC744 \uB9CC\uB4E4\uAE30 \uC704\uD574 \uC77C\uC5B4\uC130\uB358 \uAC83\uC778\uAC00? \uADF8\uB300\uC758 \uC591\uC2EC\uC740 \uC548\uB4DC\uB85C\uBA54\uB2E4\uC5D0 \uBC84\uB9B0\uC9C0 \uC624\uB798\uB418\uC5B4 \uC544\uBB34\uAC83\uB3C4 \uB290\uB07C\uB294 \uAC83\uC774 \uC5C6\uB294\uAC00? \uADF8\uB300\uB4E4\uC740 \uAC00\uC2B4\uC774 \uC544\uB2CC \uBA38\uB9AC\uB85C \uC774\uB545\uC758 \uBBFC\uC8FC\uD654\uB97C \uBD80\uB974\uC9D6\uC5C8\uB358 \uAC83\uC778\uAC00?",
