  "text" : "90\uB144\uB300 \uB9C8\uC9C0\uB9C9 \uD559\uC0DD\uC6B4\uB3D9\uC758 \uD6C4\uBC1C\uC8FC\uC790\uB85C \uC5B4\uAE68\uB97C \uBB36\uC5C8\uB358 \uC800\uB85C\uC11C\uB294 \uD559\uC0DD\uC6B4\uB3D9\uC744 \uD588\uC5C8\uB2E4\uACE0 \uAC10\uD788 \uBD80\uB044\uB7EC\uC6CC \uC5B4\uB514\uAC00\uC11C \uC598\uAE30\uB97C \uBABB\uD558\uACA0\uC2B5\uB2C8\uB2E4. \uADF8\uB54C \uBAA9\uC18C\uB9AC \uB192\uC5EC \uBD80\uB974\uC9D6\uB358 \uBAA8\uB4E0 \uAC83\uC774 \uD55C\uB0B1 \uC2E0\uAE30\uB8E8 \uAC19\uC2B5\uB2C8\uB2E4.",
