  "id_str" : "7740007872",
  "text" : "\uC591\uBC18\uB3C4 3\uC77C\uC744 \uAD76\uC73C\uBA74 \uB2F4\uC744 \uB118\uB294\uB2E4\uACE0 \uD588\uACE0, \uC218\uC5FC\uC774 \uC11D\uC790\uB77C\uB3C4 \uBA39\uC5B4\uC57C \uC0B0\uB2E4\uACE0 \uD588\uC8E0. \uC774\uB150, \uC18C\uC2E0, \uBBFF\uC74C, \uCCA0\uD559 \uC774\uB7F0\uAC70 \uB2E4 \uBD80\uC9C8\uC5C6\uC2B5\uB2C8\uB2E4. \uC790\uC2E0\uC758 \uBAA9\uC228, \uC790\uC2E0\uC758 \uACE0\uD1B5, \uC790\uC2E0\uC758 \uAC00\uC871 \uC55E\uC5D0\uC11C \uC774\uB7F0\uAC70 \uB2E4 \uBB34\uB825\uD569\uB2C8\uB2E4. \uADF8\uB7F0\uAC70\uC5D0 \uCD08\uC5F0\uD55C \uC0AC\uB78C\uC740 \uC5F4\uC0AC\uAC00 \uB418\uB294\uAC70\uC8E0..",
